import React from 'react';
import {Box} from "@mui/material";

function App() {
    return (
        <div className="App">
            <Box
                sx={{
                    height: "500px",
                    backgroundColor: "#FFF5DC"
                }}>
                Hello World
            </Box>
        </div>
    );
}

export default App;
